  \"2016-03-17T20:52:14.838890\",\n\t\"name\": \"water-use-online-permit-system\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The use of water by one person can affect
  other nearby water users and the general public.  A water use permit is required
  of any person or entity that withdraws at least 25,000 gallons in a 24 hour period
  during any calendar year. The permit lists the amount of water allowed to be withdrawn
  each year by the permittee, and is valid for 10 years.  Water Use Permits are typically
  issued to public water supply systems, industries, agricultural business, irrigation
  (both agricultural and golf courses), recreational areas, gravel quarry dewatering,
  etc.  This online database provides information on water use permits issued by the
  Department of Natural Resources.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
